import React from 'react'
import './myStyle.css'
import { FaBeer,IoIosAdd } from 'react-icons/fa';


interface data {
    numero: string;
    frase: string;
    icono: string;
}

function Card_general(props:data) {
  if (props.icono='FaBeer'){
  return (
        <div className = 'card' >

            <div className='izquierda'>
                <div className= 'numbers' >{props.numero} </div>
                <div className= 'cardName'>{props.frase}</div>
            </div>

            <div className='iconBx'>
                <FaBeer />  
            </div>

        </div>
   )
  }
  else{
    return(
        <div className = 'card' >

            <div className='izquierda'>
                <div className= 'numbers' >{props.numero} </div>
                <div className= 'cardName'>{props.frase}</div>
            </div>

            <div className='iconBx'>
                <IoIosAdd />  
            </div>

        </div>
    )
  }
  
}

export default Card_general;
